import React from 'react';
import styles from './styles.module.scss';
import Button from '../../components/Button';

const buttons = [
  {
    name: 'Pay with Estar',
    icon: '...'
  },
  {
    name: 'Pay with Estar',
    icon: '...'
  }
];

const Race = () => {
  buttons.map((button) => (
    <Button key={button.name} name={button.name} icon={button.icon} />
  ));
};

export default Race;
